// import Portals from './components/Portals';
// import InLineStyle from './components/InLineStyle';
// import Style from './components/Style';
// import StyleMoudle from './components/StyleMoudle';
// import NameList from './components/NameList';
// import Refs from './components/Refs';
// import ClickCount from './components/ClickCount';
// import HoverCount from './components/HoverCount';
// import HoverCountProps from "./components/HoverCountProps";
// import ClickCountProps from "./components/ClickCountProps";
// import PropsRender from "./components/PropsRender";
// -------------------------- Rect Router --------------------------
import { Routes, Route } from "react-router-dom";
import "./css/style.css";
import Home from "./routers/Home";
import NavBar from "./routers/NavBar";
import OrderInfo from "./routers/OrderInfo";
import Product from "./routers/Product";
import Featured from "./routers/Featured";
import New from "./routers/New";
import NoMatch from "./routers/NoMatch";
import Users from "./routers/Users";
import UserDetails from "./routers/UserDetails";
import Admin from "./routers/Admin";
// I Will Test Lazy Load For This Page To Improve Performance--------
// import About from "./routers/About";
const LazyAbout = React.lazy(() => import("./routers/About") )
// Lazy Load End ------------------------------

function App() {
  return (
    <div>
      {/* Some Tests Here... */}
      <div>
        {/* For Sharing Code Using Props Render  */}
        {/* <PropsRender render={(count, incrementCount) => <HoverCountProps count={count} incrementCount={incrementCount} />} />
      <PropsRender render={(count, incrementCount) => <ClickCountProps count={count} incrementCount={incrementCount} />} /> */}
      </div>
      <NavBar />
      <Routes>
        <Route path="/" element={<Home />} />
        {/* React Supense Is fall Back  */}
        <Route path="about" element={<React.Suspense><LazyAbout/></React.Suspense>} />
        <Route path="order-info" element={<OrderInfo />} />
        <Route path="product" element={<Product />}>
          <Route index element={<Featured />} /> 
          <Route path="featured" element={<Featured />} />
          <Route path="new" element={<New />} />
        </Route>
        <Route path="users" element={<Users />} >
          <Route path=":userID" element={<UserDetails />} />
          <Route path="admin" element={<Admin />} />
        </Route>
        <Route path="*" element={<NoMatch />} />
      </Routes>
    </div>
  );
}

export default App;
